export class ThromboseRenale {
    IdThromboseRetine: number;
    PatientId: number;
    ThromboseRenale1: boolean;
    Nombre: number;
    Date: string; 
    DouleursAbdominales?: boolean;
    HematurieMacroscopique?: boolean;
    HematurieMicroscopique?: boolean;
    DouleursLombaires?: boolean;
    Hta?: boolean;
    OligoAnurie?: boolean;
    GrosRein?: boolean;
    InsuffisanceRenale?: boolean;
    Autre?: boolean;
    PreciserAutre?: string;
    Uree: number;
    Ceatinemie: number;
    Hospitalisation: boolean;
    Lieu?: string;
    EchodopplerRenale: boolean;
    Preciser?: string;
    HyperhydratationPerso?: boolean;
    HyperhydratationIv?: boolean;
    AntalgiquesPalliesI?: boolean;
    AntalgiquePallierIi?: boolean;
    AntalgiquePallierIii?: boolean;
    TransfusionSimple?: boolean;
    EchangeTransfusionnel?: boolean;
    EpurationExtraRentale?: boolean;
  
    constructor() {
      this.IdThromboseRetine = 0;
      this.PatientId = 0;
      this.ThromboseRenale1 = false;
      this.Nombre = 0;
      this.Date = ''; 
      this.DouleursAbdominales = false;
      this.HematurieMacroscopique = false;
      this.HematurieMicroscopique = false;
      this.DouleursLombaires = false;
      this.Hta = false;
      this.OligoAnurie = false;
      this.GrosRein = false;
      this.InsuffisanceRenale = false;
      this.Autre = false;
      this.PreciserAutre = '';
      this.Uree = 0;
      this.Ceatinemie = 0;
      this.Hospitalisation = false;
      this.Lieu = '';
      this.EchodopplerRenale = false;
      this.Preciser = '';
      this.HyperhydratationPerso = false;
      this.HyperhydratationIv = false;
      this.AntalgiquesPalliesI = false;
      this.AntalgiquePallierIi = false;
      this.AntalgiquePallierIii = false;
      this.TransfusionSimple = false;
      this.EchangeTransfusionnel = false;
      this.EpurationExtraRentale = false;
    }
  }
